import React, { useState, useEffect } from "react";
import { Bar } from "react-chartjs-2";
// import apiManager from "../api/apiManager";

const RouteGraph = (props) => {
  const entries = props.entries;

  entries.map((entry) => console.log("map", entry.time, entry.attendee_count));
  entries.forEach(entry => console.log("forEach", entry.time, entry.attendee_count))

  const state = {
    labels: [entries.forEach(entry => entry.time)],
    datasets: [
      {
        backgroundColor: "rgba(75,192,192,1)",
        borderColor: "rgba(0,0,0,1)",
        borderWidth: 2,
        data: [entries.forEach(entry => entry.attendee_count)],
      },
    ],
  };

  return (
    <div>
      <Bar
        data={state}
        options={{
          title: {
            display: true,
            text: "Attendee counts over time",
            fontSize: 20,
          }
        }}
      />
    </div>
  );
};

export default RouteGraph;
